import React from "react";
import Estilo from "../Hojas de Estilos/Encabezado.css";
import logoConsultorio from '../assets/Imagenes/logo-consultorio.jpg';

import Menu from "./Menu";
function Encabezado(){
    return(
        <div className="cabecera">
            <div className="logo">
                <img src={logoConsultorio} alt="logo-consultorio"/>
            </div>
            <div className="boton-menu">
                <div className="linea linea-top"></div>
                <div className="linea linea-mid"></div>
                <div className="linea linea-bot"></div>
            </div>
            <Menu />
        </div>
    );
};
export default Encabezado;
